package grc20_marketplace

import (
	"std"
	"strings"

	"gno.land/p/demo/avl"
	"gno.land/p/demo/grc/grc20"
	"gno.land/p/demo/ownable"
	"gno.land/p/demo/ufmt"
)

var (
	fee float64 = 0.025 // initialized at 2.5%
	vault std.Address  	// address receiving fee from total supply
	admin std.Address	// admin
	instances avl.Tree // symbol -> instance
)


func init() {
	admin = std.PrevRealm().Addr()
}

func NewGRC20(name, symbol string, decimals uint, initialMint uint64, imageURL string, creator std.Address, totalSupply uint64) {
	//Should we check for token name ? to avoid conflicts different symbol but same name ?
	exists := instances.Has(symbol)
	if exists {
		panic("token already exists")
	}

	banker := grc20.NewBanker(name, symbol, decimals)
	if initialMint > 0 {
		banker.Mint(creator, initialMint)
	}

	inst := instance{
		banker: banker,
		admin:  ownable.NewWithAddress(creator),
		imageURL: imageURL,
	}

	if totalSupply > 0 {
		inst.totalSupply = totalSupply
	}

	instances.Set(symbol, &inst)
}

type instance struct {
	banker *grc20.Banker
	admin  *ownable.Ownable
	imageURL string // per-request amount. disabled if 0.
	totalSupply uint64
}

func (inst instance) Token() grc20.Token { return inst.banker.Token() }

func TotalSupply(symbol string) uint64 {
	inst := mustGetInstance(symbol)
	return inst.Token().TotalSupply()
}

func BalanceOf(symbol string, owner std.Address) uint64 {
	inst := mustGetInstance(symbol)
	return inst.Token().BalanceOf(owner)
}

func Allowance(symbol string, owner, spender std.Address) uint64 {
	inst := mustGetInstance(symbol)
	return inst.Token().Allowance(owner, spender)
}

func Transfer(symbol string, to std.Address, amount uint64) {
	inst := mustGetInstance(symbol)
	checkErr(inst.Token().Transfer(to, amount))
}

func Approve(symbol string, spender std.Address, amount uint64) {
	inst := mustGetInstance(symbol)
	checkErr(inst.Token().Approve(spender, amount))
}

func TransferFrom(symbol string, from, to std.Address, amount uint64) {
	inst := mustGetInstance(symbol)
	checkErr(inst.Token().TransferFrom(from, to, amount))
}


func Mint(symbol string, to std.Address, amount uint64) {
	inst := mustGetInstance(symbol)
	inst.admin.AssertCallerIsOwner()
	checkErr(inst.banker.Mint(to, amount))
}

func Burn(symbol string, from std.Address, amount uint64) {
	inst := mustGetInstance(symbol)
	inst.admin.AssertCallerIsOwner()
	checkErr(inst.banker.Burn(from, amount))
}

func Render(path string) string {
	parts := strings.Split(path, "/")
	c := len(parts)

	switch {
	case path == "":
		return "TODO: list existing tokens and admins"
	case c == 1:
		symbol := parts[0]
		inst := mustGetInstance(symbol)
		return inst.banker.RenderHome()
	case c == 3 && parts[1] == "balance":
		symbol := parts[0]
		inst := mustGetInstance(symbol)
		owner := std.Address(parts[2])
		balance := inst.Token().BalanceOf(owner)
		return ufmt.Sprintf("%d", balance)
	default:
		return "404\n"
	}
}

func mustGetInstance(symbol string) *instance {
	t, exists := instances.Get(symbol)
	if !exists {
		panic("token instance does not exist")
	}
	return t.(*instance)
}

func checkErr(err error) {
	if err != nil {
		panic(err)
	}
}

package token_register

import (
	token "gno.land/r/villaquiranm/grc20_launchpad"

	pusers "gno.land/p/demo/users"

	pl "gno.land/r/gnoswap/pool"
	rr "gno.land/r/gnoswap/router"
	sr "gno.land/r/gnoswap/staker"
	pf "gno.land/r/gnoswap/protocol_fee"
	cp "gno.land/r/gnoswap/community_pool"
)

type NewToken struct{}

func (NewToken) Transfer() func(to pusers.AddressOrName, amount uint64) {
	return token.Transfer
}

func (NewToken) TransferFrom() func(from, to pusers.AddressOrName, amount uint64) {
	return token.TransferFrom
}

func (NewToken) BalanceOf() func(owner pusers.AddressOrName) uint64 {
	return token.BalanceOf
}

func (NewToken) Approve() func(spender pusers.AddressOrName, amount uint64) {
	return token.Approve
}

func init() {
	pl.RegisterGRC20Interface("gno.land/r/villaquiranm/grc20_launchpad", NewToken{})
	rr.RegisterGRC20Interface("gno.land/r/villaquiranm/grc20_launchpad", NewToken{})
	sr.RegisterGRC20Interface("gno.land/r/villaquiranm/grc20_launchpad", NewToken{})
	pf.RegisterGRC20Interface("gno.land/r/villaquiranm/grc20_launchpad", NewToken{})
	cp.RegisterGRC20Interface("gno.land/r/villaquiranm/grc20_launchpad", NewToken{})
}

package lunc

import (
	"std"

	"gno.land/p/demo/grc/grc20"
	"gno.land/p/demo/ownable"
	pusers "gno.land/p/demo/users"
	"gno.land/r/demo/users"
)

var (
	banker *grc20.Banker
	admin  *ownable.Ownable
	token  grc20.Token
)

func init() {
	admin = ownable.NewWithAddress(std.PrevRealm().Addr())
	banker = grc20.NewBanker("Terra Classic", "LUNC", 100000)
	banker.Mint(admin.Owner(), 1000000*10000)
	token = banker.Token()
}

func TotalSupply() uint64 { return token.TotalSupply() }

func BalanceOf(owner pusers.AddressOrName) uint64 {
	ownerAddr := users.Resolve(owner)
	return token.BalanceOf(ownerAddr)
}

func Allowance(owner, spender pusers.AddressOrName) uint64 {
	ownerAddr := users.Resolve(owner)
	spenderAddr := users.Resolve(spender)
	return token.Allowance(ownerAddr, spenderAddr)
}

func Transfer(to pusers.AddressOrName, amount uint64) {
	toAddr := users.Resolve(to)
	checkErr(token.Transfer(toAddr, amount))
}

func Approve(spender pusers.AddressOrName, amount uint64) {
	spenderAddr := users.Resolve(spender)
	checkErr(token.Approve(spenderAddr, amount))
}

func TransferFrom(from, to pusers.AddressOrName, amount uint64) {
	fromAddr := users.Resolve(from)
	toAddr := users.Resolve(to)
	checkErr(token.TransferFrom(fromAddr, toAddr, amount))
}

func Faucet() {
	caller := std.PrevRealm().Addr()
	amount := uint64(1_000 * 10_000) // 1k
	checkErr(banker.Mint(caller, amount))
}

func Mint(to pusers.AddressOrName, amount uint64) {
	admin.AssertCallerIsOwner()
	toAddr := users.Resolve(to)
	checkErr(banker.Mint(toAddr, amount))
}

func Burn(from pusers.AddressOrName, amount uint64) {
	admin.AssertCallerIsOwner()
	fromAddr := users.Resolve(from)
	checkErr(banker.Burn(fromAddr, amount))
}

func Render(path string) string {
	return path
}

func checkErr(err error) {
	if err != nil {
		panic(err)
	}
}

